It’s been a pleasure and honor to have been given the opportunity to create and direct the new @sonyalpha 7s III launch film. Months of writing, throwing ideas away, re-writing, designing shots, shaping, molding, planning, permitting, shooting, editing and so on.  It’s been a wild ride to say the least... The heritage of this line is incredible, It really has been a game changer for the industry, time and time again. The hardest part of making this film (besides the whole pandemic bit) was designing the concepts for the story without knowing if the camera could truly perform what I was envisioning.  I remember when the cameras finally arrived, I immediately walked out onto my pitch black street, turned the camera on and saw a coyote standing in front of me.  I couldn’t see it with my eye, but the camera saw every detail with almost no noise and in nearly daylight color.  I knew at that point we had another game changer on our hands and my confidence in the plan was solidified. This camera wasn’t just innovation for innovations sake, you can feel the passion that Sony put into crafting every micron of this tool.  After spending over a month with the cameras I can honestly say that there are many instances that I would use it over a cinema camera that costs 20 times the price.  It’s an absolute beast that I want to become better friends with over the coming years.  Thank you to our team/s for the incredibly hard work on this one (full credits in comments) and a big thank you to @sonyalpha @manowitz @mparns @mo.cru_ for leading The Way Forward. 

